import React from 'react'

const Rank = ({name,entries}) =>{
        return (
            <div>
                <div className='white f3'>
                    {`${name} , your current entry count...`} // It was Rank previously
                </div>
                <div className='white f1'>
                    {entries}
                </div>
            </div>
        )
            
}

export default Rank
